CREATE DATABASE nd;

USE nd;

CREATE TABLE games (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
name  VARCHAR(100),
players VARCHAR(100),
date VARCHAR(100),
publisher VARCHAR(100),
rating VARCHAR(100),
genre VARCHAR(100),
salesNa VARCHAR(100),
salesEu VARCHAR(100),
salesJpn VARCHAR(100),
salesOther VARCHAR(100),
salesGlobal VARCHAR(100),
filename VARCHAR(100));

